// muestra los emojis
function EmojiToggle() {
    if (emojisenabled == false)
        {
            emojisenabled = true;
            emojisappend();
            $('#EmojiList').hide();
            document.getElementById('EmojiList').style.left = (offset.left + 25) + 'px';
            document.getElementById('EmojiList').style.visibility = 'visible';
            $('.emoji-lazy').click(function (event) {
                var text = document.getElementById('comment-input');
                text.value = text.value + $(event.target).attr('title');
            });
        }
    $('#EmojiList').toggle();
} ;

// añade el botón "E"
function AddButton() {
    var enviar = document.getElementsByClassName('button')[0];
    offset = $('.button').offset();
    if (typeof(enviar) != 'undefined' && enviar != null) {
        var btn = document.createElement('button');
        btn.innerHTML = 'E';
        btn.type = 'button';
        btn.setAttribute('class', 'button');
        btn.onclick = function () {EmojiToggle();};
        $('#EmojiList').toggle();
        $(enviar).after(btn);
        $('.emoji button').click(EmojiToggle);
    }
}

// INICIO
var emojisenabled = false;
var offset;
AddButton();
// FINAL

// estilo del div
